import {
  faChampagneGlasses,
  faSquare,
  faBurger,
  faGlassWater,
  faArrowDownLong,
  faArrowUpLong,
  faBriefcase,
  faCommentDollar,
  faSackDollar,
} from "@fortawesome/free-solid-svg-icons";
export const classes = {
    incoming: {
      bgColor: "light-incoming",
      color: "incoming",
    },
    transfer: {
      bgColor: "light-transfer",
      color: "transfer",
    },
    car: {
      bgColor: "light-car",
      color: "car",
    },
    bizum: {
      bgColor: "light-bizum",
      color: "bizum",
    },
    bill: {
      bgColor: "light-bill",
      color: "bill",
    },
    electricity: {
      bgColor: "light-electricity",
      color: "electricity",
    },
  };
export const itemList = [
  {
    icons: [faSquare, faChampagneGlasses],
